import _ from 'lodash';
import React, { Component } from 'react';
import cardFields from './cardFields';
import Card from './Card';
import img1 from '../../images/photo3.jpeg';

const imgStyle = {
    display: 'block',
    margin: '0 auto',
    width: '50%',
    height: 'auto',
    borderRadius: '50%',
    align: 'center'
};


class Cards extends Component {
    renderFields() {
		return _.map(cardFields, ({ key, label, cImage, cText }) => {
			return (
                <Card key={key} label={label} cImage={cImage} cText={cText} />
            );
		});
    }

	render() {
		return (
                <div className="row">
                {this.renderFields()}
                </div>
		);
	}
}

export default Cards;
